import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import AppList from './AppList';
import reportWebVitals from './reportWebVitals';

/*ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);*/

const Home = ({location}) => {
  return (
    <Layout>
      <App />
    </Layout>
  )
}

const List = ({location}) => {
  return (
    <Layout>
      <AppList />
    </Layout>
  )
}

ReactDOM.render(
    <App />,
  document.getElementById('root')
);

ReactDOM.render(
  <AppList />,
document.getElementById('root/list')
);
